"use strict";var blogApp=angular.module("blogApp",["ngRoute"]);blogApp.config(["$routeProvider","$locationProvider",function(e,o){e.when("/",{templateUrl:"templates/home.html",controller:"HomeController"}).when("/users",{templateUrl:"templates/users.html",controller:"UsersController"}).otherwise({redirectTo:"/"}),o.html5Mode(!0)}]);
blogApp.controller("HomeController",["$scope","$http",function(o,t){t({method:"GET",url:"http://localhost:8080/api/home"}).then(function(t){o.resData=t.data},function(o){alert("Problem in HomeController API request: "+o)})}]);

blogApp.controller("UsersController",["$scope","$http",function(t,o){o({method:"GET",url:"http://localhost:8080/api/users"}).then(function(o){t.resData=o.data},function(t){alert("Problem in UsersController API request: "+t)})}]);
